import React, {Component} from 'react';
import { HashRouter as Router, Route, /*Switch,*/NavLink} from 'react-router-dom';
import {profil} from '../user/profil';
import updateInfos from '../user/updateInfos';
import dashboard from '../user/dashboard';


class paramNavbar extends Component {
    render(){
        return(
                <Router>
                <div>
                    <h1>lol</h1>
                    <NavLink exact to="/dashboard">Tableau de bord</NavLink>
                    <NavLink to="/profil">Mon profil</NavLink>
                    <NavLink to="/tickets rÃ©solus">Modifier mes infos</NavLink>
                </div>
                <Route>
                    <Route exact path="/dasboard" component={dashboard}/>
                    <Route path="/profil" component={profil}/>
                    <Route path="/updateInfos" component={updateInfos}/>
                </Route>
                </Router>
            
        );
    }
}

export default paramNavbar
